    <User />
  }))

};

const User =(props) =>{
  return (<div>
    <h1 key={key} style={{color:"green"}}>{props.name}</h1>;
    <h1 key={key} style={{color:"red"}}>{props.age}</h1>
  </div>)
}

export default App
